        "teacher_solution_1": {
            "correct_answer": "B",
            "explanation": "Choice B (expectation) is correct because it describes what was planned or anticipated for dinner time. Choice A (celebration) is incorrect because the context doesn't suggest a special occasion. Choice C (distance) is incorrect because it's unrelated to planning dinner time."
        },
        "question_2": "Which word best completes the second blank?",
        "answer_choices_2": {
            "A": "walk",
            "B": "sing",
            "C": "heat"
        },
        "teacher_solution_2": {
            "correct_answer": "C",
            "explanation": "Choice C (heat) is correct because it's what you do with soup on a stove. Choice A (walk) is incorrect because you can't walk soup. Choice B (sing) is incorrect because soup cannot be sung."
        }
    }
]


